        { username: "testing233", imageUrl: "../../images/pp1.png"},
        { username: "testing233", imageUrl: "../../images/pp1.png"}
    ]);


  return (
    <div>
        <div className='statusbar_container'>
            {
                data.map((item, index)=>(
                    <div className='status'>
                <Avatar className='statusbar-status' src={statusImage} />
                <div className='status-text'>Name</div>
            </div>
                ))
            }


        </div>
    </div>
  )
}
